//articlesList
import React from "react";
import articleContent from "./articleContent";

const Articles = () => {
  return (
    <>
      <div>
        <h1>Articles</h1>
        {articleContent.map((article) => (
          <h3>{article.title}</h3>
        ))}
      </div>
    </>
  );
};

export default Articles;
